import logo from './logo.svg';
import pokeball from './Pokeball-icon.svg' ;

let number = 0;
number = 5+5-3;

let myName = 'Who?';
if (number === 10) {
  myName = 'Anthony Buciu';
} else {
  myName = '...err...uuummm... hmm I don\'t know ';
};

//Function HTML section
function Content02() {
  return (
    <div 
      id="startSection02"
      className="Main-Content" 
      style={{fontWeight:"500", height:"100vh"}}
      data-aos="fade-right"
      data-aos-anchor-placement="top-center"
      data-aos-duration="1000"
      // data-aos-offset="0"
    >
    <img 
    src={logo} 
    className="App-logo-small" 
    alt="logo"
    />
    <div>
      <span>My name is {myName}</span>
        <img src={pokeball} className="pokeball" alt="pokeball" style={{position:"relative", left:"91%", top:"20px", scale:"2"}} />
      </div>
    </div>
  );
}

export default Content02;
